import React from "react";

import '../stylesheet/componentes/btn-admin.css'


function BtnEncuestas ({funcion,encuestas}) {

    return (
        <div className="buttonsContainer">
            <button onClick={funcion[0]} className="btn-admin-style">{encuestas[0]}</button>           
            <button onClick={funcion[1]} className="btn-admin-style">{encuestas[1]}</button>           
            <button onClick={funcion[2]} className="btn-admin-style">{encuestas[2]}</button>           
        </div>
    )

}

export default BtnEncuestas;
